    const history =useHistory();
    return(
        <div className="Container">



    <Form className="form"
      initialValues={{}}
      onSubmit={(value) => {
        getData(value, "user")
        history.push('dashboard');

      }}
      btnText={"Login"}
      btn={"SignUp"}
      fields={fields}
    />

  </div>

    )

}

